import React, { Component } from 'react';
import './Home.css';
import '../Font/Font.css';
import { NavLink} from 'react-router-dom'
import MyTrips from './MyTrips';
import uYhomeLogo from '../Images/uYhomeLogo.png';
import { withAuthenticator, AmplifySignOut,  SignIn, SignUp, ConfirmSignUp, Greetings } from '@aws-amplify/ui-react';



class NavBar extends Component {


  render() {

    const getTrips = this.props.getTrips



    return (
     <div className= "navContainer"
     >
         <nav className= "navbar skin noDeco" role= "navigation"


         >
         <NavLink
         to={`/`}>
          <img className="homeLogo" src={uYhomeLogo} alt= "ultraYumm home button"/>
          </NavLink> 

      </nav>
      <MyTrips

      getTrips = {getTrips}

      /> 
       <div>
       <SignIn />
    <AmplifySignOut />
        </div>  
      </div>
    );
  }
}
export default NavBar;
